INSERT INTO `Templates` VALUES (1,0,'Blank','A blank template','Perl','','2011-08-03 21:03:41',1,1,'2011-08-03 19:34:19'),(2,0,'Autoreply','Default Autoresponse template','Perl','Subject: AutoReply: {$Ticket->Subject}\n\n\nGreetings,\n\nThis message has been automatically generated in response to the\ncreation of a trouble ticket regarding:\n	\"{$Ticket->Subject()}\", \na summary of which appears below.\n\nThere is no need to reply to this message right now.  Your ticket has been\nassigned an ID of [{$Ticket->QueueObj->SubjectTag || $rtname} #{$Ticket->id()}].\n\nPlease include the string:\n\n         [{$Ticket->QueueObj->SubjectTag || $rtname} #{$Ticket->id}]\n\nin the subject line of all future correspondence about this issue. To do so, \nyou may reply to this message.\n\n                        Thank you,\n                        {$Ticket->QueueObj->CorrespondAddress()}\n\n-------------------------------------------------------------------------\n{$Transaction->Content()}\n','2011-08-03 21:03:42',1,1,'2011-08-03 19:34:19'),(3,0,'Transaction','Default transaction template','Perl','RT-Attach-Message: yes\n\n\n{$Transaction->CreatedAsString}: Request {$Ticket->id} was acted upon.\n Transaction: {$Transaction->Description}\n       Queue: {$Ticket->QueueObj->Name}\n     Subject: {$Transaction->Subject || $Ticket->Subject || \"(No subject given)\"}\n       Owner: {$Ticket->OwnerObj->Name}\n  Requestors: {$Ticket->RequestorAddresses}\n      Status: {$Ticket->Status}\n Ticket <URL: {RT->Config->Get(\'WebURL\')}Ticket/Display.html?id={$Ticket->id} >\n\n\n{$Transaction->Content()}\n','2011-08-03 21:03:42',1,1,'2011-08-03 19:34:19'),(4,0,'Admin Correspondence','Default admin correspondence template','Perl','RT-Attach-Message: yes\n\n\n<URL: {RT->Config->Get(\'WebURL\')}Ticket/Display.html?id={$Ticket->id} >\n\n{$Transaction->Content()}\n','2011-08-03 21:03:42',1,1,'2011-08-03 19:34:20'),(5,0,'Correspondence','Default correspondence template','Perl','RT-Attach-Message: yes\n\n{$Transaction->Content()}\n','2011-08-03 21:03:42',1,1,'2011-08-03 19:34:20'),(6,0,'Admin Comment','Default admin comment template','Perl','Subject: [Comment] {my $s=($Transaction->Subject||$Ticket->Subject); $s =~ s/\\[Comment\\]\\s*//g; $s =~ s/^Re:\\s*//i; $s;}\nRT-Attach-Message: yes\n\n\n{RT->Config->Get(\'WebURL\')}Ticket/Display.html?id={$Ticket->id}\nThis is a comment.  It is not sent to the Requestor(s):\n\n{$Transaction->Content()}\n','2011-08-03 21:03:42',1,1,'2011-08-03 19:34:20'),(7,0,'Status Change','Ticket status changed','Perl','Subject: Status Changed to: {$Transaction->NewValue}\n\n\n{RT->Config->Get(\'WebURL\')}Ticket/Display.html?id={$Ticket->id}\n\n{$Transaction->Content()}\n','2011-08-03 21:03:42',1,1,'2011-08-03 19:34:20'),(8,0,'Resolved','Ticket Resolved','Perl','Subject: Resolved: {$Ticket->Subject}\n\nAccording to our records, your request has been resolved. If you have any\nfurther questions or concerns, please respond to this message.\n','2011-08-03 21:03:42',1,1,'2011-08-03 19:34:20'),(9,2,'New Pending Approval','Notify Owners and AdminCcs of new items pending their approval','Perl','Subject: New Pending Approval: {$Ticket->Subject}\n\nGreetings,\n\nThere is a new item pending your approval: \"{$Ticket->Subject()}\", \na summary of which appears below.\n\nPlease visit {RT->Config->Get(\'WebURL\')}Approvals/Display.html?id={$Ticket->id}\nto approve or reject this ticket, or {RT->Config->Get(\'WebURL\')}Approvals/ to\nbatch-process all your pending approvals.\n\n-------------------------------------------------------------------------\n{$Transaction->Content()}\n','2011-08-03 21:03:42',1,1,'2011-08-03 19:34:20'),(10,2,'Approval Passed','Notify Requestor of their ticket has been approved by some approver','Perl','Subject: Ticket Approved: {$Ticket->Subject}\n\nGreetings,\n\nYour ticket has been approved by { eval { $Approver->Name } }.\nOther approvals may be pending.\n\nApprover\'s notes: { $Notes }\n','2011-08-03 21:03:42',1,1,'2011-08-03 19:34:20'),(11,2,'All Approvals Passed','Notify Requestor of their ticket has been approved by all approvers','Perl','Subject: Ticket Approved: {$Ticket->Subject}\n\nGreetings,\n\nYour ticket has been approved by { eval { $Approver->Name } }.\nIts Owner may now start to act on it.\n\nApprover\'s notes: { $Notes }\n','2011-08-03 21:03:42',1,1,'2011-08-03 19:34:20'),(12,2,'Approval Rejected','Notify Owner of their rejected ticket','Perl','Subject: Ticket Rejected: {$Ticket->Subject}\n\nGreetings,\n\nYour ticket has been rejected by { eval { $Approver->Name } }.\n\nApprover\'s notes: { $Notes }\n','2011-08-03 21:03:42',1,1,'2011-08-03 19:34:20'),(13,2,'Approval Ready for Owner','Notify Owner of their ticket has been approved and is ready to be acted on','Perl','Subject: Ticket Approved: {$Ticket->Subject}\n\nGreetings,\n\nThe ticket has been approved, you may now start to act on it.\n\n','2011-08-03 21:03:42',1,1,'2011-08-03 19:34:20'),(14,0,'Forward','Forwarded message','Perl','\n\n{ $ForwardTransaction->Content =~ /\\S/ ? $ForwardTransaction->Content : \"This is a forward of transaction #\".$Transaction->id.\" of ticket #\". $Ticket->id }\n','2014-04-22 21:17:27',1,1,'2011-08-03 19:34:20'),(15,0,'Forward Ticket','Forwarded ticket message','Perl','\n\n{ $ForwardTransaction->Content =~ /\\S/ ? $ForwardTransaction->Content : \"This is a forward of ticket #\". $Ticket->id }\n','2014-04-22 21:17:27',1,1,'2011-08-03 19:34:20'),(16,0,'Error: public key','Inform user that he has problems with public key and couldn\'t recieve encrypted content','Perl','Subject: We have no your public key or it\'s wrong\n\nYou received this message as we have no your public PGP key or we have a problem with your key. Inform the administrator about the problem.\n','2011-08-03 21:03:42',1,1,'2011-08-03 19:34:20'),(17,0,'Error to RT owner: public key','Inform RT owner that user(s) have problems with public keys','Perl','Subject: Some users have problems with public keys\n\nYou received this message as RT has problems with public keys of the following user:\n{\n    foreach my $e ( @BadRecipients ) {\n        $OUT .= \"* \". $e->{\'Message\'} .\"\\n\";\n    }\n}','2011-08-03 21:03:42',1,1,'2011-08-03 19:34:20'),(18,0,'Error: no private key','Inform user that we received an encrypted email and we have no private keys to decrypt','Perl','Subject: we received message we cannot decrypt\n\nYou sent an encrypted message with subject \'{ $Message->head->get(\'Subject\') }\',\nbut we have no private key it\'s encrypted to.\n\nPlease, check that you encrypt messages with correct keys\nor contact the system administrator.','2011-08-03 21:03:42',1,1,'2011-08-03 19:34:20'),(19,0,'Error: bad encrypted data','Inform user that a message he sent has invalid encryption data','Perl','Subject: We received a message we cannot handle\n\nYou sent us a message that we cannot handle due to corrupted signature or encrypted block. we get the following error(s):\n{ foreach my $msg ( @Messages ) {\n    $OUT .= \"* $msg\\n\";\n  }\n}','2014-04-22 21:17:35',1,1,'2011-08-03 19:34:20'),(20,0,'PasswordChange','Inform user that his password has been reset','Perl','Subject: [{RT->Config->Get(\'rtname\')}] Password reset\n\nGreetings,\n\nSomeone at {$ENV{\'REMOTE_ADDR\'}} requested a password reset for you on {RT->Config->Get(\'WebURL\')}\n\nYour new password is:\n  {$NewPassword}\n','2011-08-03 21:03:42',1,1,'2011-08-03 19:34:20'),(21,0,'Email Digest','Email template for periodic notification digests','Perl','Subject: RT Email Digest\n\n{ $Argument }\n','2011-08-03 21:03:42',1,1,'2011-08-03 19:34:20'),(22,0,'Error: Missing dashboard','Inform user that a dashboard he subscribed to is missing','Perl','Subject: [{RT->Config->Get(\'rtname\')}] Missing dashboard!\n\nGreetings,\n\nYou are subscribed to a dashboard that is currently missing. Most likely, the dashboard was deleted.\n\nRT will remove this subscription as it is no longer useful. Here\'s the information RT had about your subscription:\n\nDashboardID:  { $SubscriptionObj->SubValue(\'DashboardId\') }\nFrequency:    { $SubscriptionObj->SubValue(\'Frequency\') }\nHour:         { $SubscriptionObj->SubValue(\'Hour\') }\n{\n    $SubscriptionObj->SubValue(\'Frequency\') eq \'weekly\'\n    ? \"Day of week:  \" . $SubscriptionObj->SubValue(\'Dow\')\n    : $SubscriptionObj->SubValue(\'Frequency\') eq \'monthly\'\n      ? \"Day of month: \" . $SubscriptionObj->SubValue(\'Dom\')\n      : \'\'\n}\n','2011-08-03 21:03:42',1,1,'2011-08-03 19:34:20'),(23,6,'Autoreply','Sent when a block is created','Perl','RT-Attach-Message: yes\nSubject: { $Ticket->Subject }\n\n{ $Transaction->Content }\n\n{ my $output = \"\";\n  my @mailfields = ( \"IP\", \"Netmask\", \"Port\", \"Where Blocked\" );\n\n  my $CustomFields = $Ticket->QueueObj->TicketCustomFields;\n  while ( my $CustomField = $CustomFields->Next ) {\n    my $name = $CustomField->Name;\n    next unless grep lc $_ eq lc $name, @mailfields;\n\n    my $Values = $Ticket->CustomFieldValues( $CustomField->Id );\n    while ( my $Value = $Values->Next ) {\n      $output .= $name .\": \". $Value->Content .\"\\n\";\n    }\n  }\n  return $output;\n}\n-------------------------------------------------------------------------\nPlease include the string:\n\n         [{ $Ticket->QueueObj->SubjectTag || $rtname } #{ $Ticket->id }]\n\nin the subject line of all future correspondence about this issue. To do so, \nyou may reply to this message.\n\n                        Thank you,\n                        { $Ticket->QueueObj->CorrespondAddress }','2011-08-03 21:03:42',1,1,'2011-08-03 19:34:24'),(24,6,'BlockRemoved','Sent when a block is removed','Perl','Subject: {$Ticket->Subject}\n\nBlock #{$Ticket->id} was removed.\n\n{ my $output = \"\";\n  my @mailfields = ( \"IP\", \"Netmask\", \"Port\", \"Where Blocked\" );\n\n  my $CustomFields = $Ticket->QueueObj->TicketCustomFields;\n  while ( my $CustomField = $CustomFields->Next ) {\n    my $name = $CustomField->Name;\n    next unless grep lc $_ eq lc $name, @mailfields;\n\n    my $Values = $Ticket->CustomFieldValues( $CustomField->Id );\n    while ( my $Value = $Values->Next ) {\n      $output .= $name .\": \". $Value->Content .\"\\n\";\n    }\n  }\n  return $output;\n}\n-------------------------------------------------------------------------\nPlease include the string:\n\n         [{ $Ticket->QueueObj->SubjectTag || $rtname } #{$Ticket->id}]\n\nin the subject line of all future correspondence about this issue. To do so, \nyou may reply to this message.\n\n                        Thank you,\n                        {$Ticket->QueueObj->CorrespondAddress()}','2011-08-03 21:03:42',1,1,'2011-08-03 19:34:24'),(25,5,'Autoreply','Sent when an investigation is launched','Perl','RT-Attach-Message: yes\nSubject: {$Ticket->Subject}\n\n{$Transaction->Content()}\n\n-------------------------------------------------------------------------\nPlease include the string:\n\n         [{ $Ticket->QueueObj->SubjectTag || $rtname } #{$Ticket->id}]\n\nin the subject line of all future correspondence about this issue. To do so, \nyou may reply to this message.\n\n                        Thank you,\n                        {$Ticket->QueueObj->CorrespondAddress()}','2011-08-03 21:03:42',1,1,'2011-08-03 19:34:24'),(26,0,'Autoreply in HTML','HTML Autoresponse template','Perl','Subject: AutoReply: {$Ticket->Subject}\nContent-Type: text/html\n\n<p>Greetings,</p>\n\n<p>This message has been automatically generated in response to the\ncreation of a trouble ticket regarding <b>{$Ticket->Subject()}</b>,\na summary of which appears below.</p>\n\n<p>There is no need to reply to this message right now.  Your ticket has been\nassigned an ID of <b>{$Ticket->SubjectTag}</b>.</p>\n\n<p>Please include the string <b>{$Ticket->SubjectTag}</b>\nin the subject line of all future correspondence about this issue. To do so,\nyou may reply to this message.</p>\n\n<p>Thank you,<br/>\n{$Ticket->QueueObj->CorrespondAddress()}</p>\n\n<hr/>\n{$Transaction->Content(Type => \'text/html\')}\n','2014-04-22 21:17:06',1,1,'2014-04-22 21:17:06'),(27,0,'Transaction in HTML','HTML transaction template','Perl','RT-Attach-Message: yes\nContent-Type: text/html\n\n<b>{$Transaction->CreatedAsString}: Request <a href=\"{RT->Config->Get(\"WebURL\")}Ticket/Display.html?id={$Ticket->id}\">{$Ticket->id}</a> was acted upon by {$Transaction->CreatorObj->Name}.</b>\n<br>\n<table border=\"0\">\n<tr><td align=\"right\"><b>Transaction:</b></td><td>{$Transaction->Description}</td></tr>\n<tr><td align=\"right\"><b>Queue:</b></td><td>{$Ticket->QueueObj->Name}</td></tr>\n<tr><td align=\"right\"><b>Subject:</b></td><td>{$Transaction->Subject || $Ticket->Subject || \"(No subject given)\"} </td></tr>\n<tr><td align=\"right\"><b>Owner:</b></td><td>{$Ticket->OwnerObj->Name}</td></tr>\n<tr><td align=\"right\"><b>Requestors:</b></td><td>{$Ticket->RequestorAddresses}</td></tr>\n<tr><td align=\"right\"><b>Status:</b></td><td>{$Ticket->Status}</td></tr>\n<tr><td align=\"right\"><b>Ticket URL:</b></td><td><a href=\"{RT->Config->Get(\"WebURL\")}Ticket/Display.html?id={$Ticket->id}\">{RT->Config->Get(\"WebURL\")}Ticket/Display.html?id={$Ticket->id}</a></td></tr>\n</table>\n<br/>\n<br/>\n{$Transaction->Content( Type => \"text/html\")}\n','2014-04-22 21:17:06',1,1,'2014-04-22 21:17:06'),(28,0,'Admin Correspondence in HTML','HTML admin correspondence template','Perl','RT-Attach-Message: yes\nContent-Type: text/html\n\nTicket URL: <a href=\"{RT->Config->Get(\"WebURL\")}Ticket/Display.html?id={$Ticket->id}\">{RT->Config->Get(\"WebURL\")}Ticket/Display.html?id={$Ticket->id}</a>\n<br />\n<br />\n{$Transaction->Content(Type => \"text/html\");}\n','2014-04-22 21:17:06',1,1,'2014-04-22 21:17:06'),(29,0,'Correspondence in HTML','HTML correspondence template','Perl','RT-Attach-Message: yes\nContent-Type: text/html\n\n{$Transaction->Content( Type => \"text/html\")}\n','2014-04-22 21:17:06',1,1,'2014-04-22 21:17:06'),(30,0,'Admin Comment in HTML','HTML admin comment template','Perl','Subject: [Comment] {my $s=($Transaction->Subject||$Ticket->Subject); $s =~ s/\\[Comment\\]\\s*//g; $s =~ s/^Re:\\s*//i; $s;}\nRT-Attach-Message: yes\nContent-Type: text/html\n\n<p>This is a comment about <a href=\"{RT->Config->Get(\"WebURL\")}Ticket/Display.html?id={$Ticket->id}\">ticket {$Ticket->id}</a>. It is not sent to the Requestor(s):</p>\n\n{$Transaction->Content(Type => \"text/html\")}\n','2014-04-22 21:17:06',1,1,'2014-04-22 21:17:06'),(31,0,'Status Change in HTML','HTML Ticket status changed','Perl','Subject: Status Changed to: {$Transaction->NewValue}\nContent-Type: text/html\n\n<a href=\"{RT->Config->Get(\"WebURL\")}Ticket/Display.html?id={$Ticket->id}\">{RT->Config->Get(\"WebURL\")}Ticket/Display.html?id={$Ticket->id}</a>\n<br/>\n<br/>\n{$Transaction->Content(Type => \"text/html\")}\n','2014-04-22 21:17:06',1,1,'2014-04-22 21:17:06'),(32,0,'Resolved in HTML','HTML Ticket Resolved','Perl','Subject: Resolved: {$Ticket->Subject}\nContent-Type: text/html\n\n<p>According to our records, your request has been resolved.  If you have any further questions or concerns, please respond to this message.</p>\n','2014-04-22 21:17:06',1,1,'2014-04-22 21:17:06'),(33,2,'New Pending Approval in HTML','Notify Owners and AdminCcs of new items pending their approval','Perl','Subject: New Pending Approval: {$Ticket->Subject}\nContent-Type: text/html\n\n<p>Greetings,</p>\n\n<p>There is a new item pending your approval: <b>{$Ticket->Subject()}</b>,\na summary of which appears below.</p>\n\n<p>Please <a href=\"{RT->Config->Get(\'WebURL\')}Approvals/Display.html?id={$Ticket->id}\">approve\nor reject this ticket</a>, or visit the <a href=\"{RT->Config->Get(\'WebURL\')}Approvals/\">approvals\noverview</a> to batch-process all your pending approvals.</p>\n\n<hr />\n{$Transaction->Content()}\n','2014-04-22 21:17:06',1,1,'2014-04-22 21:17:06'),(34,2,'Approval Passed in HTML','Notify Requestor of their ticket has been approved by some approver','Perl','Subject: Ticket Approved: {$Ticket->Subject}\nContent-Type: text/html\n\n<p>Greetings,</p>\n\n<p>Your ticket has been approved by <b>{ eval { $Approver->Name } }</b>.\nOther approvals may be pending.</p>\n\n<p>Approver\'s notes:</p>\n<blockquote>{ $Notes }</blockquote>\n','2014-04-22 21:17:06',1,1,'2014-04-22 21:17:06'),(35,2,'All Approvals Passed in HTML','Notify Requestor of their ticket has been approved by all approvers','Perl','Subject: Ticket Approved: {$Ticket->Subject}\nContent-Type: text/html\n\n<p>Greetings,</p>\n\n<p>Your ticket has been approved by <b>{ eval { $Approver->Name } }</b>.\nIts Owner may now start to act on it.</p>\n\n<p>Approver\'s notes:</p>\n<blockquote>{ $Notes }</blockquote>\n','2014-04-22 21:17:06',1,1,'2014-04-22 21:17:06'),(36,2,'Approval Rejected in HTML','Notify Owner of their rejected ticket','Perl','Subject: Ticket Rejected: {$Ticket->Subject}\nContent-Type: text/html\n\n<p>Greetings,</p>\n\n<p>Your ticket has been rejected by <b>{ eval { $Approver->Name } }</b>.</p>\n\n<p>Approver\'s notes:</p>\n<blockquote>{ $Notes }</blockquote>\n','2014-04-22 21:17:06',1,1,'2014-04-22 21:17:06'),(37,2,'Approval Ready for Owner in HTML','Notify Owner of their ticket has been approved and is ready to be acted on','Perl','Subject: Ticket Approved: {$Ticket->Subject}\nContent-Type: text/html\n\n<p>Greetings,</p>\n\n<p>The ticket has been approved, you may now start to act on it.</p>\n\n','2014-04-22 21:17:06',1,1,'2014-04-22 21:17:06'),(38,2,'Transaction in HTML','[no description]','Perl','','2014-04-22 21:17:13',1,1,'2014-04-22 21:17:13'),(39,2,'Transaction','[no description]','Perl','','2014-04-22 21:17:13',1,1,'2014-04-22 21:17:13'),(40,0,'Reminder','Default reminder template','Perl','Subject:{$Ticket->Subject} is due {$Ticket->DueObj->AsString}\n\nThis reminder is for ticket #{$Target = $Ticket->RefersTo->First->TargetObj;$Target->Id}.\n\n{RT->Config->Get(\'WebURL\')}Ticket/Display.html?id={$Target->Id}\n','2014-04-22 21:17:17',1,1,'2014-04-22 21:17:17'),(41,0,'Error: unencrypted message','Inform user that their unencrypted mail has been rejected','Perl','Subject: RT requires that all incoming mail be encrypted\n\nYou received this message because RT received mail from you that was not encrypted.  As such, it has been rejected.\n','2014-04-22 21:17:35',1,1,'2014-04-22 21:17:35');
